import React from 'react';
import "../css/Cover.css";
import { useNavigate } from "react-router-dom";
import cover from "../images/main-bg.jpg"


export default function Cover() {
    
// document.body.style.backgroundImage = {cover};
location.reload();
const navigate = useNavigate();
  return (
    <div class="container">
        <div id="main" class="container">
            <div class="row">
                <div class="col-xl-6">
                    <div id="patient" class="container">
                        <button class="btn btn-secondary btn-lg" onClick={() => navigate("/patient")}>I'm a Patient</button>
                    </div>
                </div>
                <div class="col-xl-6">
                    <div  id="doctor" class="container ">
                        <button class="btn btn-light btn-lg">I'm a Doctor</button>
                    </div>
                </div>
            </div>
        </div>
    </div>
  )
}
